          <li>
            <label>
              <input type="checkbox"/>
              <span>xxxxx</span>
            </label>
            <button className='btn btn-daner' style={{display:'none'}}>删除</button>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default App;
